//this gets the entry from the tree at the given path
function getEntryAtPath(tree,path) {
    if(path.length === 0) {
        throw new Error("Code error - looking for an entry at an empty path");
    }

    var currentIndex = 0;
    var keyList = tree;
    return getEntryFromKeyList(keyList,path,currentIndex);

}

//this is one of two recursive functions to get an entry from a path
function getEntryFromKeyList(keyList,path,currentIndex) {
    if(!keyList) return null;

    var keyEntry;
    var key = path[currentIndex];
    for(var i = 0; i < keyList.length; i++) {
        keyEntry = keyList[i];
        if(keyEntry.k == key) {
            if(currentIndex == path.length-1) {
                return keyEntry;
            }
            else if(keyEntry.input == "multikey") {
                return getEntryFromKeyList(keyEntry.ks,path,currentIndex + 1);
            }
            else {
                return getEntryFromValues(keyEntry.v,path,currentIndex + 1);
            }
        }
    }
}

//this is one of two recursive functions to get an entry from a path
function getEntryFromValues(values,path,currentIndex) {
    if(!values) return null;

    var value = path[currentIndex];
    var valueEntry = values[value];

    if(valueEntry) {
        if(currentIndex == path.length-1) {
            return valueEntry;
        }
        else {
            return getEntryFromKeyList(valueEntry.ks,path,currentIndex + 1);
        }
    }
    else {
        return null;
    }

}

//this adds a child entry to a parent
function addToParentEntry(childPresetEntry,childInputEntry,parentPresetEntry) {
    if(parentPresetEntry.k) {
        if(parentPresetEntry.input == "multikey") {
            insertKey(childPresetEntry,parentPresetEntry);
        }
        else {
            insertValue(childInputEntry.v,childPresetEntry,parentPresetEntry);
        }
    }
    else {
        if(childPresetEntry.k) {
            insertKey(childPresetEntry,parentPresetEntry);
        }
        else {
            throw new Error("Error - only keys can be added to values.");
        }
    }
}

//This adds a child key to a parent value
function insertKey(childPresetEntry,parentPresetEntry) {
    var keys = parentPresetEntry.ks;
    if(!keys) {
        keys = [];
        parentPresetEntry.ks = keys;
    }
    if(!keyInList(childPresetEntry,keys)) {
        keys.push(childPresetEntry);
    }
}

//This function tests if a key entry is in a list
function keyInList(presetEntry,entryList) {
    var matchFunction = function(entry) {
        return (presetEntry.k == entry.k);
    }
    var index = entryList.findIndex(matchFunction);
    return (index >= 0);
}

//this adds a child value to a parent key
function insertValue(value,childPresetEntry,parentPresetEntry) {
    var values = parentPresetEntry.v;
    if(!values) {
        values = {};
        parentPresetEntry.v = values;
    }
    if(!valueInMap(value,values)) {
        values[value] = childPresetEntry;
    }
}

//This function tests if a value is in a map
function valueInMap(value,entryMap) {
    return (entryMap[value] !== undefined);
}

//This creates a preset entry for the give input entry
function createPresetEntry(entry) {
    var presetEntry = {};

    //common optional fields
    //not used for tree - include with VERBOSE flag
    if(VERBOSE) {
        if(entry.desc) {
            presetEntry.desc = entry.desc;
        }
        if(entry.dep !== undefined) {
            presetEntry.dep = entry.dep;
        }
    }

    if(entry.type == "key") {
        //main fields
        presetEntry.k = entry.k;
        presetEntry.input = entry.input

        //optional field
        if(entry.required !== undefined) {
            presetEntry.required = entry.required;
        }
        if(entry.is_array !== undefined) {
            presetEntry.is_array = entry.is_array;
        }
        if(entry.has_lang !== undefined) {
            presetEntry.has_lang = entry.has_lang;
        }
        if(entry.prop) {
            presetEntry.prop = entry.prop;
        }

        //dependent fields
        if(entry.fixed_value !== undefined) {
            //on input type fixed
            presetEntry.fixed_value = entry.fixed_value;
        }
        if(entry.name !== undefined) {
            //optionally on named keys reference
            presetEntry.name = entry.name;
        }
    }
    else if(entry.type == "value") {
        //no main or optional to add here
    }
    else {
        throw new Error("Unknown type");
    }

    return presetEntry;

}

